learning:
Learned about string patterns, sorting and grouping. Also learned about sub-queries and nested selects. 
           Some aggregate functions can't be used as is, for example SELECT * FROM Employees WHERE Salary < AVG(Salary). This will throw an error.
           Instead, we should use this SELECT * FROM Employees WHERE Salary < (SELECT AVG(Salary) FROM Employees) AS Salary;
           We can also use queries to work with multiple tables. For example, SELECT * FROM Employees, Departments; SELECT * FROM Employees E, Departments D WHERE E.Dep_Id = D.Dep_Id_Dep;

Learned about working with multiple tables in SQL queries. Examples include: SELECT JOB_TITLE, MIN_SALARY, MAX_SALARY, JOB_IDENT FROM JOBS WHERE JOB_IDENT IN (SELECT JOB_ID FROM EMPLOYEES WHERE YEAR(B_DATE) > 1976);
           SELECT J.JOB_TITLE, J.MIN_SALARY, J.MAX_SALARY, J.JOB_IDENT FROM JOBS J, EMPLOYEES E WHERE E.JOB_ID = J.JOB_IDENT AND YEAR(E.B_DATE) > 1976;
           Also learned that Python supports access to databases, including database querying.
